"   <div class=\"block pha drugH1Div\" id=\"F171640\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Interferes with fungal cytochrome P450 activity (lanosterol 14-&alpha;-demethylase), decreasing ergosterol synthesis (principal sterol in fungal cell membrane) and inhibiting cell membrane formation",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F171658\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : ~0.6 L/kg; widely throughout body with good penetration into CSF, eye, peritoneal fluid, sputum, skin, and urine",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Relative diffusion blood into CSF: Adequate with or without inflammation (exceeds usual MICs)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     CSF:blood level ratio: Normal meninges: 50% to 90%; Inflamed meninges: ~80%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding, plasma: 11% to 12%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Oral: &gt;90%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Normal renal function: ~30 hours (range: 20-50 hours); Elderly: ~46 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: Oral: 1-2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (80% as unchanged drug)",
"    </p>",
"   </div>",
