var title_f16_12_16589="Human TCR delta chain";
var content_f16_12_16589=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F64384&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F64384&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 634px\">",
"   <div class=\"ttl\">",
"    Organization of the human T cell receptor delta chain locus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 614px; height: 159px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There is one V delta gene within the V alpha region. There are also five genes in V alpha that may rearrange with either J alpha or J delta. There is an additional V delta gene between V alpha and D delta, and one more 3' (to the right) of C delta. There are three D delta, and four J delta genes. There is a single C delta gene.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Moss, PA, Rosenberg, WM, Bell, Jl. The human T cell receptor in health and disease. Ann Rev Immunol 1992; 10:71.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
